import React from 'react';

import './styles.css';
import logo_img from '../../assets/logo.svg';

export default function Profile(){
    return(
        <div className="profile-container">
            <header>
                <img src={logo_img} alt="Be The Hero"/>
            </header>
        </div>
    );
}
